  <title>Interactive Map with Popups</title>
  <style>
    * {
      box-sizing: border-box;
    }
    
    body {
      margin: 0;
      padding: 0;
      overflow: hidden;
      touch-action: none;
    }
    
    #map-container {
      width: 100vw;
      height: 100vh;
      overflow: hidden;
      position: relative;
      touch-action: none;
    }
    
    #map-wrapper {
      width: 100%;
      height: 100%;
      position: relative;
      transform-origin: center center;
      transition: none;
      touch-action: none;
    }
    
    svg {
      width: 100%;
      height: 100%;
      display: block;
      touch-action: none;
    }
    
    .interactive-location {
      cursor: pointer;
      pointer-events: all;
      -webkit-tap-highlight-color: transparent;
    }
    
    .interactive-location:hover {
      opacity: 0.8;
    }
    
    .popup-overlay {
      position: fixed;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      background: rgba(0,0,0,0.6);
      display: none;
      justify-content: center;
      align-items: center;
      z-index: 1000;
      touch-action: auto;
    }
    
    .popup-content {
      background: #fff;
      padding: 20px;
      border-radius: 10px;
      max-width: 90%;
      max-height: 80vh;
      overflow-y: auto;
      box-shadow: 0 0 10px rgba(0,0,0,0.3);
      position: relative;
      transform: scale(1) !important;
    }
    
    .close-popup {
      float: right;
      font-size: 24px;
      cursor: pointer;
      line-height: 1;
      margin: -5px -5px 10px 10px;
    }
    
    @media (max-width: 768px) {
      .popup-content {
        max-width: 95%;
        max-height: 70vh;
        padding: 15px;
      }
    }
  </style>
</head>

    <path d="M675.6,55.1c.1,0,.2.1.2.3,0,.1-.1.4-.3.7-.2.3-.3.5-.5.6-.1,0-.2,0-.3,0l-1.8-1.5.4,2.3c0,.1,0,.2-.2.3-.1,0-.4.1-.7.1s-.6,0-.7-.1c-.1,0-.2-.2-.2-.3l.4-2.3-1.8,1.5c0,0-.2,0-.3,0-.1,0-.3-.3-.5-.6-.2-.3-.3-.5-.3-.7,0-.1,0-.2.2-.3l2.2-.9-2.2-.9c-.1,0-.2-.1-.2-.3,0-.1,0-.4.3-.7.2-.3.3-.5.5-.6.1,0,.2,0,.3,0l1.8,1.5-.4-2.3c0-.1,0-.2.2-.3.1,0,.4-.1.7-.1s.6,0,.7.1c.1,0,.2.2.2.3l-.4,2.3,1.8-1.5c0,0,.2,0,.3,0,.1,0,.3.3.5.6.2.3.3.5.3.7,0,.1,0,.2-.2.3l-2.2.9,2.2.9Z">
    </path>

  <div id="popup" class="popup-overlay" onclick="hidePopup()">
    <div class="popup-content" onclick="event.stopPropagation()">
      <span class="close-popup" onclick="hidePopup()">&times;</span>
      <div id="popup-text"></div>
    </div>
  </div>
 <script>
  const programs = {
    safehome: {
      name: "Safehome, Inc.",
      city: "Overland Park, Kansas",
      counties: "Johnson, Miami",
      services: "Domestic Violence",
      website: "http://www.safehome-ks.org/",
      hotline: "888-432-4300, or 913-262-2868"
    },
    friendsofyates: {
      name: "Friends of Yates - Della Gill/Joyce H. Williams Center",
      city: "Kansas City, Kansas",
      counties: "Wyandotte",
      services: "Domestic Violence",
      website: "http://www.friendsofyates.org/",
      hotline: "913-321-0951"
    },
    aafv: {
      name: "Alliance Against Family Violence",
      city: "Leavenworth, Kansas",
      counties: "Leavenworth",
      services: "Domestic Violence and Sexual Assault",
      website: "https://www.aafvks.org/",
      hotline: "913-675-7217"
    },
    safehope: {
      name: "Safehope, Inc.",
      city: "Newton, Kansas",
      counties: "Harvey, Marion, McPherson",
      services: "Domestic Violence and Sexual Assault",
      website: "http://www.safehope.net/",
      hotline: "800-487-0510 or 316-283-0350"
    },
    catholiccharities: {
      name: "Catholic Charities Harbor House",
      city: "Wichita, Kansas",
      counties: "Sedgwick",
      services: "Domestic Violence",
      website: "http://catholicdioceseofwichita.org/",
      hotline: "866-899-5522 or 316-263-6000"
    },
    stepstone: {
      name: "StepStone, Inc.",
      city: "Wichita, Kansas",
      counties: "Sedgwick",
      services: "Domestic Violence",
      website: "http://www.stepstoneks.org/stepstone",
      hotline: "316-265-1611"
    },
    wasac: {
      name: "Wichita Area Sexual Assault Center (WASAC)",
      city: "Wichita, Kansas",
      counties: "Cowley, Sedgwick, Sumner",
      services: "Sexual Assault",
      website: "http://wichitasac.com/",
      hotline: "877-927-2248 or 316-263-3002 o español: 316-263-2044"
    },
    wichitafamilycrisis: {
      name: "Wichita Family Crisis Center, Inc.",
      city: "Wichita, Kansas",
      counties: "Cowley, Sedgwick, Sumner",
      services: "Domestic Violence",
      website: "http://www.wichitafamilycrisiscenter.org/",
      hotline: "316-267-7233"
    }
  };
  function showPopup(id) {
    const data = programs[id];
    if (!data) return;
    const content = `
      <h3>${data.name}</h3>
      <p><strong>City:</strong> ${data.city}</p>
      <p><strong>Counties Served:</strong> ${data.counties}</p>
      <p><strong>Services:</strong> ${data.services}</p>
      <p><strong>Website:</strong> <a href="${data.website}" target="_blank">${data.website}</a></p>
      <p><strong>Crisis Hotline:</strong><a href="tel:${data.hotline}"> ${data.hotline}</a></p>
    `;
    document.getElementById('popup-text').innerHTML = content;
    document.getElementById('popup').style.display = 'flex';
  }
  function hidePopup() {
    document.getElementById('popup').style.display = 'none';
  }
  
  
  // Pinch-to-zoom functionality
  const mapWrapper = document.getElementById('map-wrapper');
  const mapContainer = document.getElementById('map-container');
  
  // Zoom state
  let transform = {
    scale: 1,
    x: 0,
    y: 0
  };
  
  // Touch state
  let touches = {
    start: [],
    current: [],
    lastCenter: null,
    lastDistance: 0
  };
  
  // Flags
  let isPinching = false;
  let isPanning = false;
  
  // Helper function to get distance between two touch points
  function getDistance(t1, t2) {
    const dx = t1.clientX - t2.clientX;
    const dy = t1.clientY - t2.clientY;
    return Math.sqrt(dx * dx + dy * dy);
  }
  
  // Helper function to get center point between two touches
  function getCenter(t1, t2) {
    return {
      x: (t1.clientX + t2.clientX) / 2,
      y: (t1.clientY + t2.clientY) / 2
    };
  }
  
  // Apply transform to map
  function updateTransform() {
    mapWrapper.style.transform = `translate(${transform.x}px, ${transform.y}px) scale(${transform.scale})`;
  }
  
  // Constrain pan within bounds
  function constrainTransform() {
    const containerRect = mapContainer.getBoundingClientRect();
    const scaledWidth = containerRect.width * transform.scale;
    const scaledHeight = containerRect.height * transform.scale;
    
    const maxX = Math.max(0, (scaledWidth - containerRect.width) / 2);
    const maxY = Math.max(0, (scaledHeight - containerRect.height) / 2);
    
    transform.x = Math.max(-maxX, Math.min(maxX, transform.x));
    transform.y = Math.max(-maxY, Math.min(maxY, transform.y));
    
    // Reset position if scale is 1
    if (transform.scale === 1) {
      transform.x = 0;
      transform.y = 0;
    }
  }
  
  // Touch event handlers
  mapContainer.addEventListener('touchstart', function(e) {
    const touchList = Array.from(e.touches);
    
    if (touchList.length === 2) {
      e.preventDefault();
      isPinching = true;
      isPanning = false;
      
      // Store initial touch positions
      touches.start = touchList.map(t => ({ x: t.clientX, y: t.clientY }));
      touches.current = touches.start.slice();
      touches.lastDistance = getDistance(touchList[0], touchList[1]);
      touches.lastCenter = getCenter(touchList[0], touchList[1]);
    } else if (touchList.length === 1 && transform.scale > 1) {
      // Only allow panning when zoomed in and not on interactive elements
      if (!e.target.closest('.interactive-location')) {
        isPanning = true;
        isPinching = false;
        touches.start = [{ x: touchList[0].clientX, y: touchList[0].clientY }];
        touches.current = touches.start.slice();
      }
    }
  }, { passive: false });
  
  mapContainer.addEventListener('touchmove', function(e) {
    const touchList = Array.from(e.touches);
    
    if (isPinching && touchList.length === 2) {
      e.preventDefault();
      
      // Update current touch positions
      touches.current = touchList.map(t => ({ x: t.clientX, y: t.clientY }));
      
      // Calculate scale
      const currentDistance = getDistance(touchList[0], touchList[1]);
      const scale = currentDistance / touches.lastDistance;
      
      // Calculate new scale value
      const newScale = transform.scale * scale;
      transform.scale = Math.max(1, Math.min(5, newScale));
      
      // Calculate zoom center
      const currentCenter = getCenter(touchList[0], touchList[1]);
      const rect = mapContainer.getBoundingClientRect();
      
      // Adjust position to zoom towards pinch center
      if (transform.scale > 1) {
        const dx = currentCenter.x - touches.lastCenter.x;
        const dy = currentCenter.y - touches.lastCenter.y;
        
        transform.x += dx;
        transform.y += dy;
        
        // Zoom towards center
        const zoomPointX = currentCenter.x - rect.left - rect.width / 2;
        const zoomPointY = currentCenter.y - rect.top - rect.height / 2;
        
        transform.x -= zoomPointX * (scale - 1);
        transform.y -= zoomPointY * (scale - 1);
      }
      
      // Update last values for next frame
      touches.lastDistance = currentDistance;
      touches.lastCenter = currentCenter;
      
      constrainTransform();
      updateTransform();
      
    } else if (isPanning && touchList.length === 1 && transform.scale > 1) {
      e.preventDefault();
      
      const current = { x: touchList[0].clientX, y: touchList[0].clientY };
      const dx = current.x - touches.current[0].x;
      const dy = current.y - touches.current[0].y;
      
      transform.x += dx;
      transform.y += dy;
      
      touches.current[0] = current;
      
      constrainTransform();
      updateTransform();
    }
  }, { passive: false });
  
  mapContainer.addEventListener('touchend', function(e) {
    if (e.touches.length === 0) {
      isPinching = false;
      isPanning = false;
      touches.start = [];
      touches.current = [];
    } else if (e.touches.length === 1) {
      isPinching = false;
      // Could transition to panning here if needed
    }
  });
  
  // Mouse wheel zoom for desktop
  mapContainer.addEventListener('wheel', function(e) {
    e.preventDefault();
    
    const delta = e.deltaY > 0 ? 0.9 : 1.1;
    const newScale = Math.max(1, Math.min(5, transform.scale * delta));
    
    if (newScale !== transform.scale) {
      const rect = mapContainer.getBoundingClientRect();
      const mouseX = e.clientX - rect.left - rect.width / 2;
      const mouseY = e.clientY - rect.top - rect.height / 2;
      
      // Calculate scale change
      const scaleChange = newScale / transform.scale;
      
      // Update scale
      transform.scale = newScale;
      
      // Adjust position to zoom towards mouse position
      transform.x = mouseX - (mouseX - transform.x) * scaleChange;
      transform.y = mouseY - (mouseY - transform.y) * scaleChange;
      
      constrainTransform();
      updateTransform();
    }
  }, { passive: false });
  
  // Mouse drag for desktop
  let isMouseDragging = false;
  let mouseStart = { x: 0, y: 0 };
  
  mapContainer.addEventListener('mousedown', function(e) {
    if (transform.scale > 1 && !e.target.closest('.interactive-location')) {
      isMouseDragging = true;
      mouseStart.x = e.clientX - transform.x;
      mouseStart.y = e.clientY - transform.y;
      mapContainer.style.cursor = 'grabbing';
      e.preventDefault();
    }
  });
  
  mapContainer.addEventListener('mousemove', function(e) {
    if (isMouseDragging && transform.scale > 1) {
      transform.x = e.clientX - mouseStart.x;
      transform.y = e.clientY - mouseStart.y;
      constrainTransform();
      updateTransform();
    }
  });
  
  mapContainer.addEventListener('mouseup', function() {
    isMouseDragging = false;
    updateCursor();
  });
  
  mapContainer.addEventListener('mouseleave', function() {
    isMouseDragging = false;
    updateCursor();
  });
  
  // Update cursor style based on scale
  function updateCursor() {
    if (transform.scale > 1) {
      mapContainer.style.cursor = 'grab';
    } else {
      mapContainer.style.cursor = 'default';
    }
  }
  
  // Initialize cursor
  updateCursor();
  
  // Reset zoom on double tap
  let lastTap = 0;
  mapContainer.addEventListener('touchend', function(e) {
    if (e.touches.length === 0 && !e.target.closest('.interactive-location')) {
      const currentTime = new Date().getTime();
      const tapLength = currentTime - lastTap;
      if (tapLength < 300 && tapLength > 0) {
        e.preventDefault();
        transform.scale = 1;
        transform.x = 0;
        transform.y = 0;
        updateTransform();
        updateCursor();
      }
      lastTap = currentTime;
    }
  });
  
  // Prevent default touch behavior only for multi-touch
  document.addEventListener('touchstart', function(e) {
    if (e.target.closest('#map-container') && e.touches.length > 1) {
      e.preventDefault();
    }
  }, { passive: false });
  
  document.addEventListener('gesturestart', function(e) {
    e.preventDefault();
  });
  
  document.addEventListener('gesturechange', function(e) {
    e.preventDefault();
  });
  
  document.addEventListener('gestureend', function(e) {
    e.preventDefault();
  });
  </script>
